149e500a-60b6-4032-b70e-aa0e08ee097e.debug:
{
  "query": "
query FocusProjectCandidateSearch($searchString: String!, $first: Int!, $after:String) {
    rateLimit{
        cost
        limit
        nodeCount
        remaining
        resetAt
        used
    }
    search(type:REPOSITORY, query:$searchString, first:$first, after:$after){
        pageInfo {
            startCursor
            hasNextPage
            endCursor
        }
        repositoryCount
        nodes{
            ...RepositorySummary
        }
    }
}
fragment RepositorySummary on Repository{
    nameWithOwner
    isInOrganization
    owner{
        login
    }
    forkCount
    stargazerCount
    pullRequests{
        totalCount
    }
    issues{
        totalCount
    }
    mentionableUsers{
        totalCount
    }
    watchers{
        totalCount
    }
}
",
  "variables": {
    "searchString": "is:public template:false archived:false stars:>=50 forks:>=50 size:>=1000 pushed:>=2023-10-07 created:2016-12-14..2016-12-18",
    "first": 100,
    "after": null
  }
}

